svg.script:
    var timeline = new TimelineMax({onComplete:onComplete});

timeline.addLabel("time_track1", 0.25);

var tweens = TweenMax.staggerTo(".rayLine",1000,{ease:Linear.easeNone,repeat:-1,"stroke-dashoffset":-20000}, .35);

for(var i=0;i<tweens.length;i++){
	var tween = tweens[i];
	tween.progress(Math.random()+0.5);
	tween.timeScale(Math.random()+0.5);
}


timeline.set("svg", {opacity:1});

timeline.staggerFrom(".mainLineEnd", .15, {ease:Power2.easeOut, scale:.0001, transformOrigin:"center", repeat:-1, yoyo:true, repeatDelay:.25},.1, "time_track1-=2");
timeline.staggerFrom(".topLineEnd", .15, {ease:Power2.easeOut, scale:.0001, transformOrigin:"center", repeat:-1, yoyo:true, repeatDelay:.5}, .1, "time_track1-=2");
timeline.staggerFrom(".bottomLineEnd", .15, {ease:Power2.easeOut, scale:.0001, transformOrigin:"center", repeat:-1, yoyo:true, repeatDelay:.75},.1, "time_track1-=2");
timeline.fromTo(".largeBurst", 2.5, {ease:Linear.easeNone,repeat:-1,"stroke-dashoffset":0}, {ease:Linear.easeNone,repeat:-1,"stroke-dashoffset":-40}, "time_track1");
timeline.fromTo(".smallBurst", 2.5, {ease:Linear.easeNone,repeat:-1,"stroke-dashoffset":0}, {ease:Linear.easeNone,repeat:-1,"stroke-dashoffset":-40}, "time_track1-=1");

timeline.staggerTo(".key", 2, {y:-990, ease:Sine.easeInOut, yoyo:true, repeat:-1},2, "time_track1-=4");
timeline.staggerTo(".keyLine", 2, {scaleY:.28, transformOrigin:"50% 0%",  ease:Sine.easeInOut, yoyo:true, repeat:-1},2, "time_track1-=4");

timeline.staggerFrom(".rightAnchor", 2, {x:40, y:-40, repeat:-1, yoyo:true, ease:Power4.easeInOut},.2, "time_track1");
timeline.staggerFrom(".leftAnchor", 2, {x:-40, y:-40, repeat:-1, yoyo:true, ease:Power4.easeInOut},.2, "time_track1-=2");

timeline.fromTo(".rightMask", 2.5, {x:0, y:0}, {x:-20, y:20, repeat:-1, yoyo:true, ease:Power2.easeInOut}, "time_track1");
timeline.fromTo(".leftMask", 2.5, {x:0, y:0}, {x:20, y:20, repeat:-1, yoyo:true, ease:Power2.easeInOut}, "time_track1-=3.5");

timeline.from("#innerHouseRotationPoint, .ventCircle", 80, {rotation:-360, transformOrigin:"center", ease:Linear.easeNone, repeat:-1}, "time_track1");

timeline.fromTo(".innerRing", 20, {ease:Linear.easeNone,repeat:-1,"stroke-dashoffset":0}, {ease:Linear.easeNone,repeat:-1,"stroke-dashoffset":300}, "time_track1");
timeline.fromTo(".dashedBreathLine", 200, {ease:Linear.easeNone,repeat:-1,"stroke-dashoffset":0}, {ease:Linear.easeNone,repeat:-1,"stroke-dashoffset":3000}, "time_track1");
timeline.staggerFrom(".breathLines1 path", .5, {scale:.0001, ease:Power2.easeInOut, transformOrigin:"center", yoyo:true, repeat:-1, repeatDelay:.5},.1, "time_track1");
timeline.staggerFrom(".breathLines2 path", .5, {scale:.0001, ease:Power2.easeInOut, transformOrigin:"center", yoyo:true, repeat:-1, repeatDelay:.5},.1, "time_track1");
timeline.from("#innerHouseRing", 2, {rotation:20, transformOrigin:"center", ease:Power2.easeInOut, repeat:-1, yoyo:true}, "time_track1");

timeline.staggerFrom(".floatingCenter", .3, {scale:.0001, transformOrigin:"center", ease:Linear.easeNone, yoyo:true, repeat:-1, repeatDelay:.35}, .5, "time_track1");
timeline.fromTo(".floatingCenterDash", 50, {ease:Linear.easeNone,repeat:-1,"stroke-dashoffset":0}, {ease:Linear.easeNone,repeat:-1,"stroke-dashoffset":1000}, "time_track1");

timeline.staggerFromTo(".plane", 1.5, {y:-6}, {y:6, yoyo:true, repeat:-1, ease:Sine.easeInOut}, .5, "time_track1");


var isComplete=true;
function onComplete(){
	isComplete=true;
}
